import React from 'react';
import { View, StyleSheet } from 'react-native'


function WordOfDay ({word}) {


  return (
    <View styles={styles.baseText}>
        <h1>
          {word}
        </h1>
   </View>
  )
}

const styles = StyleSheet.create({
  baseText: {
    fontFamily: 'SFProDisplay-Regular',
    fontSize: 24,
    color: '#60BADA'
  }
});


export default WordOfDay;
